  constructor() {
    super();
    this.state = {
      name: 'React',
    };
    this.onChangeValue = this.onChangeValue.bind(this);
  }

  onChangeValue(event) {
    console.log(event.target.value);
  }

  render() {
    return (
      <div onChange={ this.onChangeValue }>
        <input type="radio" value="Ingredientes" name="gender" />
        {' '}
        Ingredientes
        <input type="radio" value="Nome" name="gender" />
        {' '}
        Nome
        <input type="radio" value="Primeira letra" name="gender" />
        {' '}
